import React, { useState } from 'react'
import { Form } from 'react-bootstrap'
import { useDispatch } from 'react-redux'
import { filter } from '../redux/Actions';

function Filter() {
  const dispatch = useDispatch();
  const [etat, setEtat]= useState(false);
  return (
        <div style={{width:"100px", float:"right", marginRight:"32%", marginTop:"-8%"}}>
      <Form className='Form'>
        <Form.Group  >
        <select onChange={() => dispatch(filter(etat))}>
            <option >Filter</option>
            <option value="1" onClick={()=> alert("done")} >Done</option>
            <option value="2" onClick={()=> alert("todo")}>ToDo</option>
            <option value="0">All</option>
          </select>
        </Form.Group>

      </Form>
    </div>
  )
}

export default Filter
